import React, { Component } from 'react';

class Articles extends Component {
  render() {
    return (
      <div>
        <ul>
          <li>an article</li>
          <li>another article</li>
          <li>yet another article</li>
        </ul>
      </div>
    );
  }
}

export default Articles;
